"use strict";(function(){const collapseElementList=[].slice.call(document.querySelectorAll(".card-collapsible"));const expandElementList=[].slice.call(document.querySelectorAll(".card-expand"));const closeElementList=[].slice.call(document.querySelectorAll(".card-close"));let cardDnD=document.getElementById("sortable-4");if(collapseElementList){collapseElementList.map(function(collapseElement){collapseElement.addEventListener("click",event=>{event.preventDefault();new bootstrap.Collapse(collapseElement.closest(".card").querySelector(".collapse"));collapseElement.closest(".card-header").classList.toggle("collapsed");Helpers._toggleClass(collapseElement.firstElementChild,"mdi-chevron-down","mdi-chevron-up")})})}if(expandElementList){expandElementList.map(function(expandElement){expandElement.addEventListener("click",event=>{event.preventDefault();Helpers._toggleClass(expandElement.firstElementChild,"mdi-fullscreen","mdi-fullscreen-exit");expandElement.closest(".card").classList.toggle("card-fullscreen")})})}document.addEventListener("keyup",event=>{event.preventDefault();if(event.key==="Escape"){const cardFullscreen=document.querySelector(".card-fullscreen");if(cardFullscreen){Helpers._toggleClass(cardFullscreen.querySelector(".card-expand").firstChild,"mdi-fullscreen","mdi-fullscreen-exit");cardFullscreen.classList.toggle("card-fullscreen")}}});if(closeElementList){closeElementList.map(function(closeElement){closeElement.addEventListener("click",event=>{event.preventDefault();closeElement.closest(".card").classList.add("d-none")})})}if(typeof cardDnD!==undefined&&cardDnD!==null){Sortable.create(cardDnD,{animation:500,handle:".card"})}})();$(function(){const cardReload=$(".card-reload");if(cardReload.length){cardReload.on("click",function(e){e.preventDefault();var $this=$(this);$this.closest(".card").block({message:'<div class="sk-fold sk-primary"><div class="sk-fold-cube"></div><div class="sk-fold-cube"></div><div class="sk-fold-cube"></div><div class="sk-fold-cube"></div></div><h5>LOADING...</h5>',css:{backgroundColor:"transparent",border:"0"},overlayCSS:{backgroundColor:$("html").hasClass("dark-style")?"#000":"#fff",opacity:.55}});setTimeout(function(){$this.closest(".card").unblock();if($this.closest(".card").find(".card-alert").length){$this.closest(".card").find(".card-alert").html('<div class="alert alert-solid-danger alert-dismissible fade show" role="alert"><button type="button" class="btn-close" data-bs-dismiss="alert" aria-label="Close"></button><span class="fw-medium">Holy grail!</span> Your success/error message here.</div>')}},2500)})}});